import React from "react";
import {
  useNavigate,
  useLocation
} from "react-router-dom";

function WeatherInfo() {

    var a = fetch(
        "https://goweather.herokuapp.com/weather/stockholm")
            .then((res) => res.json())
            .then((json) => {
            return json;
            });

        return (
            <body>
            <h1>Hello, world!</h1>
            <h2>It is {a["temperature"]}</h2>
            </body>
        );
}

export default WeatherInfo;
